package com.xzx.xzxms.vm;public class ProjectSchedule {    private long proId;    private String proName;    private long inquiryId;    private long quoteId;    private int bussStatus;    private int techStatus;    private int comStatus;    private int finStatus;    private int inquiryStatus;    private int quoteStatus;    public long getProId() {        return proId;    }    public void setProId(long proId) {        this.proId = proId;    }    public String getProName() {        return proName;    }    public void setProName(String proName) {        this.proName = proName;    }    public long getInquiryId() {        return inquiryId;    }    public void setInquiryId(long inquiryId) {        this.inquiryId = inquiryId;    }    public long getQuoteId() {        return quoteId;    }    public void setQuoteId(long quoteId) {        this.quoteId = quoteId;    }    public int getBussStatus() {        return bussStatus;    }    public void setBussStatus(int bussStatus) {        this.bussStatus = bussStatus;    }    public int getTechStatus() {        return techStatus;    }    public void setTechStatus(int techStatus) {        this.techStatus = techStatus;    }    public int getComStatus() {        return comStatus;    }    public void setComStatus(int comStatus) {        this.comStatus = comStatus;    }    public int getFinStatus() {        return finStatus;    }    public void setFinStatus(int finStatus) {        this.finStatus = finStatus;    }    public int getInquiryStatus() {        return inquiryStatus;    }    public void setInquiryStatus(int inquiryStatus) {        this.inquiryStatus = inquiryStatus;    }    public int getQuoteStatus() {        return quoteStatus;    }    public void setQuoteStatus(int quoteStatus) {        this.quoteStatus = quoteStatus;    }}